import "./Chart.css"

const Chart=()=>{

    return(
        <div className="chart">
        {props.dataPoints.map((dataPoint)=>(
            <ChartBar
            key ={dataPoint.title}
            value={dataPoint.value}
            maxValue="null"
            label={dataPoint.label}
            >
            
            </ChartBar>
        )

        )
        

            }
        </div>
    )
}

